import topData from '../data/cuticle.json';
import '../styles/pages.scss'

const Cuticle = () => {
  return (
    <>
    <div className='page cuticle'>
    <h1>CUTICLE</h1>
    <div className='outBox'>
        {
            topData.map(item=>(
                <div key={item.id} className='inBox'>
                    <img src={item.img} />
                    <h3>{item.name}</h3>
                    <h2>{item.price}Ïõê</h2>
                </div>
            ))
        }
    </div>
</div>
</>

  )
}

export default Cuticle
